export default[{
    path: '/OS',
    name: 'OS',
    component: resolve => require(["@/views/index"], resolve),
    children:[
        {
            //用户消息
            path:'/booking_order_list',
            name:'booking_order_list',
            component:resolve => require(['@/views/OS/customOrder/custom_order_list'],resolve),
            meta:{
                title:'量体预约单'
            }
        },{
            //用户消息
            path:'/booking_order_detail',
            name:'booking_order_detail',
            component:resolve => require(['@/views/OS/customOrder/booking_order_detail'],resolve),
            meta:{
                title:'量体预约单详情'
            }
        },{
            //用户消息
            path:'/custom_order_list',
            name:'custom_order_list',
            component:resolve => require(['@/views/OS/customOrder/custom_order_list'],resolve),
            meta:{
                title:'定制订单'
            }
        },{
            //用户消息
            path:'/custom_order_detail',
            name:'custom_order_detail',
            component:resolve => require(['@/views/OS/customOrder/custom_order_detail'],resolve),
            meta:{
                title:'定制订单详情'
            }
        }
        
    ]
}]
